import Spinner from '../layout/Spinner';
import {getGithubRepos} from '../../actions/profile';

const ProfileGitHub = ({usernmae,getGithubRepos,repos}) => {

useEffect(() => {
    getGithubRepos(usernmae);
}, [getGithubRepos(usernmae)]);

